import React from 'react'

import '../App.css';
import { Button } from './Button';
import './Hero.css';
import { Typing } from 'react-typing';
import ReactTypingEffect from 'react-typing-effect';

function Hero() {

	const ReactTypingEffectDemo = () => {
		return (
		  <>
			<ReactTypingEffect
			  text={["Hello.", "World!"]}
			/>

			<br />

			<ReactTypingEffect

			  text={["Hello.", "World!!!"]}
			  cursorRenderer={cursor => <h1>{cursor}</h1>}
			  displayTextRenderer={(text, i) => {
				return (
				  <h1>
					{text.split('').map((char, i) => {
					  const key = `${i}`;
					  return (
						<span
						  key={key}
						  style={i%2 === 0 ? { color: 'grey'} : {}}
						>{char}</span>
					  );
					})}
				  </h1>
				);
			  }}        
			/>
		  </>
		);
	  };

	return (
		<div className="hero-container">
			<video src="/videos/video.mov"  type="video/quicktime"  autoPlay loop muted />
		<h1><Typing >
      Hello friend!
    </Typing></h1>
			{/* <p> I'm Bart, Front End developer from Pola </p> */}
			<p>  </p>
			<div className="hero-btns">

				<Button className='btns' b buttonStyle='btn--outline'
				buttonSize='btn--large'>My Project


				</Button>
				<Button className='btns' buttonStyle='btn--primary'
				buttonSize='btn--large'>
					About Me


				</Button>
			</div>

		</div>


	)
}

export default Hero
